// @ts-ignore
export * from "./ajax";
export * from "./anchor";
export * from "./color";
export * from "./config";
export * from "./cull";
import * as _DOM from "./dom";
export { _DOM as DOM };
export * from "./env";
export * from "./event";
export * from "./geo";
export { BKDRHash, djb2hash, guid } from "./hash";
export * from "./lineAtOffset";
export * from "./lodash-adapter";
export * from "./lru_cache";
// export * from './mini-adapter/index';
import * as _Satistics from "./statistics";
export { _Satistics as Satistics };
export * from "./tileset-manager";
export * from "./worker-helper";
export * from "./workers/triangulation";
export * from "./interface/map";
export function defaultValue(v1, v2) {
  if (v1 === undefined || v1 === null) {
    return v2;
  }
  return v1;
}
